/*Table structure for table `t_patient_return_visit` */

DROP TABLE IF EXISTS `t_patient_return_visit`;

CREATE TABLE `t_patient_return_visit` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT 'id（病人回访表）',
  `patient_id` int(11) DEFAULT NULL COMMENT '患者id',
  `name` varchar(32) DEFAULT NULL COMMENT '患者姓名 （回访时候录入，与patient表中的不相干！）',
  `sex` int(11) DEFAULT NULL COMMENT '患者性别（回访时候录入，与patient表中的不相干！）',
  `area` varchar(128) DEFAULT NULL COMMENT '患者所在地区（回访时候录入，与patient表中的不相干！）',
